window.bookSummaryJSON = "<p>London, England. An attempted assassination goes awry, leaving multiple people wounded or dead. Jack Noble finds himself in the middle. Now the high-profile politician who was targeted wants him even closer. </p> <p>Crystal River, Florida. The brother Jack hasn't seen in over six years calls. The news is bad, and Jack has to break the vow he made never to go home. </p> <p>Jack coordinates a security effort on one continent and investigates a mysterious death on another. Neither task is his specialty. </p> <p>Jack is left in a position where he can only react to the external forces pulling him in every direction - all while second-guessing his instincts. </p> <p>Will those instincts be enough to keep himself and those closest to him alive? </p>"; 
